s.setup = ()=>{
    s.createCanvas(400,400);
    console.log(e.get("hi"))
}
s.draw = ()=>{
    s.background(0);
    s.fill(255);
    s.text(e.get("hi"),... ( e.get("hi","pos") ?? vec2(10,10) ))
    try{
        for(let i = 0; i < 10; i++){
        for(let j = 0 ; j< 10 ; j++){
            s.fill( ... (e.get("colGrid",i,j,"color") ?? [255]))
            let pos = e.get("colGrid",i,j) ?? vec2(0,0);
            s.rect( pos.x + 20 + i*20, pos.y + 100 + j*20 ,10,10)
        }
        }
    }catch(e){
        console.log(e)
    }
}
